import React from 'react';
import './AboutUs.css';

const AboutUs = () => {
  return (
    <div className="about-us">
      <div className="about-us-header">
        <img src="/images/about-us.png" alt="About Us" />
        <h1>About Us</h1>
      </div>

      <div className="about-us-body">
        <p>
          We are a company that is passionate about building innovative products that make a difference in people's lives. We believe that technology has the power to solve some of the world's biggest problems, and we are committed to using our skills and knowledge to make a positive impact.
        </p>

        <p>
          Our team is made up of experienced and talented engineers, designers, and product managers. We are all driven by a shared desire to create products that are user-friendly, efficient, and effective.
        </p>

        <p>
          We are always looking for new ways to improve our products and services. We believe that feedback from our users is essential to our success, and we encourage you to share your thoughts and suggestions with us.
        </p>
      </div>

      <div className="about-us-footer">
        <img src="/images/about-us-footer.png" alt="About Us Footer" />
      </div>
    </div>
  );
};

export default AboutUs;
